          <Article
            imgUrl={blog02}
            date="Sep 26, 2022"
            title="GPT-3 and Open  AI is the future. Care to explore?"
          />
          <Article
            imgUrl={blog03}
            date="Sep 26, 2022"
            title="GPT-3 and Open  AI is the future. Care to explore?"
          />
          <Article
            imgUrl={blog04}
            date="Sep 26, 2022"
            title="GPT-3 and Open  AI is the future. Care to explore?"
          />
          <Article
            imgUrl={blog05}
            date="Sep 26, 2022"
            title="GPT-3 and Open  AI is the future. Care to explore?"
          />
        </div>
      </div>
    </div>
  );
};

export default Blog;
